import React from "react";
import Avatar from "./Avatar";
import "./styles.css";

function Card(props){
    return <div className="card">
        <div className="top">
            <h2 className="name">{props.name}</h2>
            <Avatar img = {props.img}/>
        </div>
    </div>;
}

export default Card;
